reviews.review_text:
Gem of a 1994.. Take that for what it is. I think 1993 and 1994 had some really nice high points––this show is one of those.

Really the whole show has a really great feel and energy, playing and vocally. Some flubbed lyrics now and again, but damn...the boys have been at it for 30 years at this point, and the sound is just thick and full throughout.

Highlights for me include: 
- Row Jimmy –– Jerry's guitar work is fast and on-point and slow and lyrical when it needs to be, the harmonizing at is impeccable for 1994, just the right amount of Vince on the higher end;
- Cowboys songs –– nice and fast, perfect low- / high-fret picking twang and strumming balance, with all the intros/phrasing nailed, Jerry wailing in harmony with Bob...these songs don't get much better post 1990;
- Tennessee –– thick with sound, Phil bombs, and more twang, like TJ should be, the build-up from around 5-min mark to 8-min...with Jerry fooling everyone and wanting to keep going at around 7;
- Samson –– a great version, with the band and crowd seeming to push each other higher and higher;
- UJB –– uniquely beautiful version, the scaled-back, strum-heavy intro featuring mostly Jerry is just perfect, along with nice harmonizing throughout, and a cool multi-tempo jam to close it out;
- Other One –– oh, baby...slowly-building, revving the crowd up, w/ Phil's thunder perfect at around 2:10, one of those driving versions 
- Cosmic Charlie tease > Wharf Rat –– super cool and reminiscent of Richfield Coliseum on 9-9-1993 (SOTM jam > Black Peter)

Give it a spin, fellow Heads!
